from sympy import S
def a(n):
    p = 1
    while p <= n:
        p *= S.GoldenRatio
    d = 0
    while n > 0:
        d *= 10
        p /= S.GoldenRatio
        if p <= n:
            n -= p
            d += 1
    return d
